import Cabecalho from './Cabecalho';

function App() 
{
  return (
    <div className="App">

      <header className = "cabecalho"> 
        {Cabecalho()} 
      </header>

      <meio className = "conteudo">
          Edit <code>src/App.js</code> and save to reload.
      </meio>

      <div className= "mochila">
          Learn React
      </div>

    </div>
  );
}

export default App;
